import { Component, OnInit } from '@angular/core';
import { FormControl, NgForm, NgModel } from '@angular/forms';
import { ActivatedRoute } from '@angular/router';
import { Categorie } from 'src/app/models/categories';

@Component({
  selector: 'app-form-categorie',
  templateUrl: './form-categorie.component.html',
  styleUrls: ['./form-categorie.component.css']
})
export class FormCategorieComponent implements OnInit {

  categorie: Categorie = new Categorie(); 

  constructor(private activated:ActivatedRoute) {}
  onSubmit() {
    if (this.categorie) {
      console.log('Form data:', this.categorie);
       }
  }
  add(f:NgForm,title:NgModel){
    this.categorie.available=true;
  console.log(f);
  console.log(title);
  }
  ngOnInit(): void {
    this.categorie = new Categorie();
    this.activated.params.subscribe({
      next:(param)=>{
        if (param['obj']!=undefined){
          console.log(JSON.parse(param['obj']))
          this.categorie=JSON.parse(param['obj'])
        }
      }
    })
  }

}
<div class="container">
  <div class="row">
    <form (ngSubmit)="onSubmit()" #form="ngForm">
      <div class="container">
        <div class="row">

          <div class="mb-3">
            <label for="title">Title :</label>
            <input type="text" class="form-control" id="title" #title="ngModel" [(ngModel)]="categorie.title" name="title" required minlength="3">
            <div *ngIf="title.invalid && (title.touched || title.dirty)" class="text-danger">
              <small *ngIf="title.errors?.['required']">Le titre est requis.</small>
              <small *ngIf="title.errors?.['minlength']">Le titre doit contenir au moins 3 caractères.</small>
            </div>
          </div>

          <div class="mb-3">
            <label for="image">Image URL :</label>
            <input type="text" class="form-control" id="image" [(ngModel)]="categorie.image"#image="ngModel" name="image" required>
            <div *ngIf="!image?.valid" class="text-danger">
              <small *ngIf="image?.errors?.['required']">L'URL de l'image est requise.</small>
            </div>
          </div>

          <div class="mb-3">
            <label for="description">Description :</label>
            <textarea class="form-control" id="description" rows="3" #description="ngModel"[(ngModel)]="categorie.description" name="description" required></textarea>
            <div *ngIf="form.submitted && !description?.valid" class="text-danger">
              <small *ngIf="description?.errors?.['required']">La description est requise.</small>
            </div>
          </div>

          <div class="mb-3 form-check">
            <input type="checkbox" class="form-check-input" id="available" [(ngModel)]="categorie.available" name="available">
            <label class="form-check-label" for="available">Available</label>
          </div>

          <div class="mb-3">
            <button type="submit" class="btn btn-primary" (click)="add(form,title)" [disabled]="form.invalid">Submit</button>
          </div>

        </div>
      </div>
    </form>
  </div>
</div>
